option java_package = "pl.edu.icm.coansys.importers.models";
option java_outer_classname = "KeywordExtractionProtos";

message ExtractedKeywords{
    required string docId = 1;
    optional int64 timestamp = 2;
    repeated string keyword = 3;
    optional string algorithm = 4;
    optional string comment = 5;
}
